import { BrowserRouter as Router, Routes, Route } from 'react'
import logo from './assets/k-r8-logo.png'
import './App.css'
import Home from './Home'
import Nav from './Nav'

function App() {

  return (
    <Router>
      <Routes>
        <Nav />
        <Route exact path='/' element={<Home />} />
      </Routes>
    </Router>
  )
}

export default App;
